import React from 'react';
import './App.css';

function Menu() {
  return (
    <div>
      <nav className='menu'>
        <a href="home">Home</a>
        <a href="clientes">Clientes</a>
        <a href="addClientes">Add clientes</a>
        <a href="usuarios">Usuários</a>
        <a href="addUsuarios">Add Usuários</a>
        <a href="login">Sair</a>
      </nav>
    </div>
  );
}

export default Menu;
